import urllib.parse
import json


def decrypt_url(encrypted_url):
    """
    Decrypt the URL by decoding its 'data' parameter.
    """
    parsed_url = urllib.parse.urlparse(encrypted_url)
    params = urllib.parse.parse_qs(parsed_url.query)
    if 'data' in params:
        decoded_data = urllib.parse.unquote(params['data'][0])
        params['data'] = [decoded_data]
        new_query = urllib.parse.urlencode(params, doseq=True)
        decrypted_url = urllib.parse.urlunparse(
            (parsed_url.scheme, parsed_url.netloc, parsed_url.path, parsed_url.params, new_query, parsed_url.fragment))
        return decrypted_url
    return encrypted_url


def extract_json_from_url(decrypted_url):
    """
    Extract JSON from the decrypted URL.
    """
    parsed_url = urllib.parse.urlparse(decrypted_url)
    params = urllib.parse.parse_qs(parsed_url.query)
    if 'data' in params:
        return json.loads(params['data'][0])
    return {}


def encrypt_url(decrypted_url):
    """
    Encrypt the URL by encoding its 'data' parameter.
    """
    parsed_url = urllib.parse.urlparse(decrypted_url)
    params = urllib.parse.parse_qs(parsed_url.query)
    if 'data' in params:
        encoded_data = urllib.parse.quote(params['data'][0])
        params['data'] = [encoded_data]
        new_query = urllib.parse.urlencode(params, doseq=True)
        encrypted_url = urllib.parse.urlunparse(
            (parsed_url.scheme, parsed_url.netloc, parsed_url.path, parsed_url.params, new_query, parsed_url.fragment))
        return encrypted_url
    return decrypted_url


def construct_url_from_json(base_url, json_data):
    """
    Construct URL from JSON data.
    """
    encoded_data = urllib.parse.quote(json.dumps(json_data))
    constructed_url = f"{base_url}&data={encoded_data}"
    return constructed_url


def print_res(encrypted_url):
    decrypted = decrypt_url(encrypted_url)
    json_data = extract_json_from_url(decrypted)
    encrypted_again = encrypt_url(decrypted)
    constructed_url = construct_url_from_json("BASE_URL", json_data)

    print("\nDecrypted URL:", decrypted)
    print("\nExtracted JSON:", json_data)
    print("\nEncrypted Again:", encrypted_again)
    print("\nConstructed URL:", constructed_url)


